import { Component } from '@angular/core';

import { ApiCallService } from '../api-call.service';

import { User } from '../User';

@Component({
  selector: 'app-api-connect',
  templateUrl: './api-connect.component.html',
  styleUrls: ['./api-connect.component.css']
})
export class ApiConnectComponent {

  constructor( 
    private ApiCallService: ApiCallService) { }

    // ------------------------------- Properties
    response = '';

    users : User[] = [];

    // Call the api routes
    callAPi2(method, url, callback, dataObj = null, token=null) {
      var obj1 = this;
      if (!dataObj) {
        dataObj = {};
      }
      this.ApiCallService.fetchCall(dataObj ,url, method, callback, token, obj1);
    }

    // Call the api routes
    callAPi1(method, url, callback, params = null, header = null) {
      var obj1 = this;
      this.ApiCallService.reqCall(method, url, callback, obj1, params, header);
    }

    // Token
    callback2(thisObj,res, result) {
      console.log(res);
      console.log(result);

      thisObj.response = result.data.token;
      thisObj.users = {};
    }

    // All users / all logged on
    callback3(thisObj, res, result) {
      console.log(result.data);
      thisObj.users = result.data.data;

      console.log(result.data.data[0].name)
      thisObj.response = 'Success';
    }

    // All users / all logged on
    callback4(thisObj, res, result) {
      console.log(result.data);
      // thisObj.users = result.data.data;

      // console.log(result.data.data[0].name)
      thisObj.response = 'Success';
    }

    // Token
    route2() {
      this.callAPi2('GET', 'https://me-api.ysojs.se/token', this.callback2);
    }

    route3() {
      this.callAPi2('POST', 'https://me-api.ysojs.se/users/allUsers', this.callback3);
    }

    // allLoggedOn
    route8() {
      var url = 'https://me-api.ysojs.se/users/allLoggedOn';
      var params;
      params = {};
      this.callAPi2('POST', url, this.callback3, params);
    }

    // Test the new API
    // Calls the API and returns the data to a callback
    testAPI() {
      var url = 'http://localhost:8333/';
      var params;
      params = {};
      this.callAPi2('POST', url, this.callback3, params);
    }
}
<div class="centerColumn">
        <h1> Api connect </h1>
        <p> Hardcoded using API http://wwww.me-api.ysojs.se</p>
        <p> Demo connecting to an API on a server, connected to a database.</p>
        <p> The API means entrances to an application that return data or perform some task. 
            These entrances are made available, like buttons. <br>
            The backend API server is made with Node.js & express - javascript programming.
            The frontend which provides the graphical interface, the view and buttons visible, is made with the framework Angular.</p>


        <div class="btns">
            <!-- <div (click)="route1()" class="submitBtn"> Introduction  </div> -->
            <div (click)="route2()" class="submitBtn"> Token  </div>
            <div (click)="route3()" class="submitBtn"> All users  </div>
            <div (click)="route8()" class="submitBtn"> All logged on  </div>
            <div (click)="route8()" class="submitBtn"> testAPI </div>

        </div>

        <div class="response">
            <h2> Response: </h2>
            <p> {{response}} </p>
        </div>

        <ul class="users">
            <li *ngFor="let user of users">
                <b> {{user.name}} </b> {{user.email}} 
            </li>
        </ul>
